		</div>
		<!-- #endif -->
		
        <!-- 首页头部 -->
		<view class="only_header">
			<view class="header_l">
				<template v-if="!token">
					<image class="img" src="/static/home/avatar.png" mode=""></image>
					<view class="btn-group">
						<view class="btn-t">未登录</view>
						<view class="btn-b">
							<text class="btn btn-reg" @tap="showReg"></text>
							<text class="btn btn-log" @tap="showLog"></text>
						</view>
					</view>
				</template>
				<template v-else>
					<view @tap="centerGo">
						<image class="img" src="/static/home/avatar.png" mode=""></image>
					</view>
					<view class="btn-group">
						<view class="btn-t">{{userInfo.username}}</view>
						<view class="btn-b">
							<image class="img" src="/static/home/vip1.png" mode=""></image>
						</view>
					</view>
				</template>
				
			</view>
			<view class="header_m">
				<view class="brance" @tap="refreshBalance">{{token?userInfo.balance:'0.0'}}</view>
			</view>
			<view class="header_r">
				<view class="web">
					<text class="web_url">官方网址：{{weburl}}</text>
					<text class="btn_copy" @tap="copyUrl(weburl)">复制</text>
				</view>
				<view class="set" @tap="handleSet">
					<text class="set_icon"></text>
					<text class="set_text">设置</text>
				</view>
			</view>
		</view>
		<!-- 首页主体 -->
		<view class="main" :class="{'bg-qp':bgqp==true,'bg-zr':bgzr==true,'bg-ty':bgty==true,'bg-dz':bgdz==true,'bg-by':bgby==true,'bg-cp':bgcp==true,}">
			<view class="main-l">
				<!-- 侧边栏 -->
				<view class="only_sidebar">
					<view class="side_item" :class="{'on':index==slideMark}" v-for="(item,index) in navList" :key="index" @tap="whoami(index)">
						<image class="side_icon" :src="item.navicon" mode=""></image>
						<text class="side_text">{{item.navtitle}}</text>
					</view>
				</view>
			</view>
			<view class="main-r">
				<!-- 公告栏 -->
				<view class="notice">
					<view class="notice_icon"></view>
					<view class="notice_text">
						<!-- #ifdef H5 -->
						<NoticeBar :scrollable="true" :single="true" :text="noticeList[0].content"></NoticeBar>
						<!-- #endif -->
						<!-- #ifndef H5 -->
						<uni-notice-bar :scrollable="true" :single="true" :text="noticeList[0].content" />
						<!-- #endif -->
						
					</view>
				</view>
				<!-- 游戏大厅 -->
				<scroll-view scroll-x="true" scroll-left="0" @scroll="hideHandle" :class= "{'animation-slide-right':animate_right==true}">
					<view :class="gameList[slideMark].list.length<=8?'gamebox2':'gamebox'">
						<view class="game_item" v-for="(item,index) in gameList[slideMark].list" :key="index" @tap="goGame(item)">
							<image :src="baseUrl+item.image" class="img" mode="aspectFit"></image>
						</view>
						<view v-if="slideState" class="game_more">
							<image class="img" src="../../static/slide2.png" mode=""></image>
						</view>
					</view>
				</scroll-view>
				
			</view>
		</view>
		<!-- 首页底部 -->
		<Footer></Footer>
		<!-- 登陆框 -->
	    <loginer :visible="loginState" v-on:logincallback="closeLog"></loginer>
		<!-- 注册框 -->
		<Register :visible="regState" v-on:regcallback="closeReg"></Register>
		<!-- 设置框 -->
		<Setter :visible="setState" v-on:setcallback="closeSet"></Setter>
	</view>
</template>
<script>
	import NoticeBar from '@/components/uni-notice-bar/uni-notice-bar.vue'
	import uniNoticeBar from '@/components/uni-notice-bar1/uni-notice-bar.vue'
	import http from '@/common/vmeitime-http/interface.js'
	import Footer from '@/components/footer/footer.vue'
	import Loginer from '@/components/login/login.vue'
	import Register from '@/components/register/register.vue'
	import Setter from '@/components/set/set.vue'
	import {
		mapGetters
	} from 'vuex'
	import {
		mapActions
	} from 'vuex'
	export default {
		data() {
			return {
				weburl:'www.hongbat.com',
				baseUrl:http.config.baseUrl,
				loginState:false,
				regState:false,
				setState:false,
				slideMark:0,
				loading:false,
				slideState:true,
				animate_right:true,
				bgqp:true,
				bgzr:false,
				bgty:false,
				bgdz:false,
				bgby:false,
				bgcp:false,
				noticeList:[
					{
						content:''
					}
				],
				gameList:[
					{
						list:[]
					}
				],
				gameList2:[],
				showList:[],
				liveList:[],
				sportList:[],
				cardList:[],
				emeList:[],
				fishList:[],
				lotteryList:[],
				navList:[
					{
						navtitle: '棋牌游戏',
						navicon: '../../static/home/sidebar_card.png'
					},
					{
						navtitle: '真人视讯',
						navicon: '../../static/home/sidebar_live.png'
					},
					{
						navtitle: '体育赛事',
						navicon: '../../static/home/sidebar_sport.png'
					},
					{
						navtitle: '电子游戏',
						navicon: '../../static/home/sidebar_eme.png'
					},
					{
						navtitle: '捕鱼游戏',
						navicon: '../../static/home/sidebar_fish.png'
					},
					{
						navtitle: '彩票游戏',
						navicon: '../../static/home/sidebar_hot.png'
					},
				]
				
			}
		},
		computed: {
			...mapGetters(['token', 'userInfo'])
		},
		components: {
			Footer,
			Loginer,
			Register,
			Setter,
			NoticeBar,
			uniNoticeBar
		},
		mounted(){},
		onShow(){
			// #ifdef APP-PLUS
				plus.screen.lockOrientation("landscape");
			// #endif
		},
		onLoad() {
			this.getNoticeList();
			this.getGameList();
		},
		methods: {
			...mapActions("user", ["getUserInfo"]),
			showReg(){
				this.$btnVoile();
				this.regState = true;
			},
			showLog(){
				this.$btnVoile();
				this.loginState = true;
			},
			centerGo(){
				this.$btnVoile();
				this.$tool.toPowerUrl('/pages/user_center/user_center');
			},
			backGo() {
				this.$tool.goBack();
			},
			closeLog(state){
				this.loginState = state;
			},
			closeReg(state){
				this.regState = state;
			},
			closeSet(state){
				this.setState = state;
			},
			hideHandle(e){
				let scrollLeft = e.detail.scrollLeft;
				if(scrollLeft>0){
					this.slideState = false;
				}
			},
			handleSet(){
				this.$btnVoile();
				this.setState = true;
			},
			copyUrl(item){
				this.$btnVoile();
				// #ifdef APP-PLUS
				   uni.setClipboardData({
				   		data: item
				   })
				// #endif
				
				// #ifdef H5
				
				// #endif
			},
			// 获取公告
			getNoticeList(){
				this.$api.getNotice().then(res=>{
					this.noticeList = res.data.data;
				})
			},
			// 获取游戏
			getGameList(){
				this.loading = false;
				uni.showLoading()
				this.$api.getGameList().then(res=>{
					uni.hideLoading();
					this.loading = true;
					this.gameList = res.data.data;
				})
			},
			// 进游戏
			goGame(obj){
				if(this.token){
					uni.showLoading()
					http.post(obj.apiurl,{action:'togames',gametype:obj.type}).then(res=>{
						uni.hideLoading();
						const gameurl = res.data.data.url
					    // #ifdef H5
					       location.href = gameurl;
					    // #endif
						// #ifdef APP-PLUS
						   this.$tool.toUrl('/pages/webview/webview',{url:gameurl});
						// #endif
					})
					
				}else{
				    this.$tool.showMag("未登录");	
				}
			},
			whoami(index) {
				this.$btnVoile();
				this.animate_right = false;
				setTimeout(()=>{
					this.animate_right = true;
					this.slideMark = index;
				},100)
				
				this.bgqp = false;
				this.bgzr = false;
				this.bgty = false;
				this.bgdz = false;
				this.bgby = false;
				this.bgcp = false;
				
				switch (index){
					case 0:
					    this.bgqp = true;
						break;
					case 1:
					    this.bgzr = true;
						break;
					case 2:
					    this.bgty = true;
						break;
					case 3:
					    this.bgdz = true;
						break;
					case 4:
					    this.bgby = true;
						break;
					case 5:
					    this.bgcp = true;
						break;
					default:
						break;
				}
				   
			},
			// 刷新余额
			refreshBalance() {
				this.$btnVoile();
				this.getUserInfo();
			}
		}
	}
</script>
